import React from 'react';
import Carousel from 'react-bootstrap/Carousel';
import "./Carousel.css";

const CardCarousel = () => {
    return (
        <Carousel>
  <Carousel.Item>
    <img
    //   className="d-block w-100"
      src="https://via.placeholder.com/800x400"
      alt="First slide"
    />
  </Carousel.Item>
  <Carousel.Item>
    <img
    //   className="d-block w-100"
      src="https://via.placeholder.com/800x400"
      alt="Second slide"
    />
  </Carousel.Item>
  <Carousel.Item>
    <img
    //   className="d-block w-100"
      src="https://via.placeholder.com/800x400"
      alt="Third slide"
    />
  </Carousel.Item>
</Carousel>
    )
}
export default CardCarousel;
